import React from 'react'
import './Downbar.css'

const Downbar = () => {
    return (
        <div className='downbar'>
            <p>Uka Tarsadia University - 2016 All Rights Reserved</p>
            <p>CopyRight &copy; <a href='http://utu.ac.in/' target="_blank" className='colorLink1'>UTU</a></p>
        </div>
    )
}

export default Downbar
